def formatSeconds(s):
	timeObj=time.gmtime(s)
	timeStr=''
	if s<60:
		timeStr=f'{round(s,2)}'
	else:
		if timeObj.tm_yday-1>0:
			timeStr+=f'{timeObj.tm_yday-1}'
		if timeObj.tm_hour>0:
			timeStr+=f'{timeObj.tm_hour}'
		if timeObj.tm_min>0:
			timeStr+=f'{timeObj.tm_min}'
		if timeObj.tm_sec>=0:
			timeStr+=f'{timeObj.tm_sec}'
	return timeStr

